Spanning the length of Roger Ebert's career as the leading American movie critic, this book contains all of his four-star reviews written during that time. A great guide for movie watching.

About the Author

Roger Ebert is the Pulitzer Prize-winning film critic of the Chicago Sun-Times and cohost of the national television program Ebert and Roeper. His reviews are syndicated internationally in more than 200 newspapers and available online at www.rogerebert.com. A recipient of the 2005 Syndication Personality Lifetime Achievement Award, Roger resides in Chicago, Ill.

